import styled from "styled-components";

export const LessorInfo = styled.div`
display: flex;
width: 100%;
height: fit-content;
flex-wrap: wrap;
`

export const Title = styled.h3`
width: 100%;
font-size: 20px;
font-family: "Roboto-Bold";
text-align: start;
margin: 0;
`

export const Information = styled.p`
font-size: 16px;
font-family: "Roboto";
margin: 0 ;
`
